int AppCoDescriptor::findField(const char *fieldName) const
{
    omnetpp::cClassDescriptor *basedesc = getBaseClassDescriptor();
    int base = basedesc ? basedesc->getFieldCount() : 0;
    if (fieldName[0] == 's' && strcmp(fieldName, "seq_S") == 0) return base+0;
    if (fieldName[0] == 't' && strcmp(fieldName, "targetHostId") == 0) return base+1;
    if (fieldName[0] == 'S' && strcmp(fieldName, "Ses") == 0) return base+2;
    if (fieldName[0] == 'i' && strcmp(fieldName, "id") == 0) return base+3;
    if (fieldName[0] == 'm' && strcmp(fieldName, "msgOrder") == 0) return base+4;
    return basedesc ? basedesc->findField(fieldName) : -1;
}

